ce to educate your readers about yourself. Why should they listen to you. What makes you an expert in the field of writing. Tell them why are you an authority in the niche and why should they learn from you.</p>\n<p>Tell them about your personal life as well. Tell them about your book and writing experience. Why you decided to write this book and why you chose this topic. What goals do you want to achieve with this book and how are those goals important.</p>\";s:21:\"author_about_me_image\";s:82:\"http://demo.mufaqar.com/dev3/wp-content/themes/double-down/images/author-image.jpg\";s:15:\"author_facebook\";s:19:\"http://facebook.com\";s:14:\"author_twitter\";s:18:\"http://twitter.com\";s:17:\"author_googleplus\";s:23:\"https://plus.google.com\";s:15:\"author_linkedin\";s:19:\"http://linkedin.com\";s:20:\"author_email_address\";s:16:\"john@website.com\";s:16:\"author_blog_icon\";s:85:\"http://demo.mufaqar.com/dev3/wp-content/themes/double-down/images/blog-posts-icon.png\";s:19:\"author_blog_heading\";s:45:\"Do you want to communicate with your readers?\";s:23:\"author_blog_sub_heading\";s:62:\"Blogging is the best way you can do it. Go, write a blog post.\";s:25:\"author_blog_readmore_text\";s:19:\"View All Blog Posts\";s:25:\"author_blog_readmore_link\";s:0:\"\";s:27:\"author_footer_banner_layout\";s:7:\"f_b_l_1\";s:19:\"author_fbb_showhide\";i:0;s:25:\"author_footer_banner_icon\";s:87:\"http://demo.mufaqar.com/dev3/wp-content/themes/double-down/images/footer-optin-icon.png\";s:18:\"custom_css_post_id\";i:632;}', 'yes'),
