(26, 1, '2022-07-21 09:51:02', '2022-07-21 09:51:02', 'Vi er noen ildsjeler som tror at fersk, hjemmelaget og smakfull mat gjør hverdagen bedre. <strong>Double Down Dish AS</strong> er laget for alle som ønsker dette i løpet av arbeidsdagen, men som kanskje ikke har tid eller kapasitet til det.\r\n\r\nHver dag lager, pakker og leverer vi matbokser til alle dere flinke folk, på arbeidsplassen deres.\r\n\r\nVi har 3 kategorier å velge mellom hver dag: «<strong>Dagens Brødmat</strong>», «<strong>Dagens Brødmat</strong>» og «<strong>Dagens Brødmat</strong>» og «<strong>Dagens Brødmat</strong>».\r\n\r\nI tillegg til velsmakende snacks, drikke og sunn snacks!\r\n\r\nEttersom vi lager alt fra bunnen av kan vi selvsagt tilpasse matboksene for allergener eller andre behov/ønsker.\r\n\r\nEnkelt, effektivt og utrolig godt!\r\n<h5>Hvem er vi?</h5>\r\n<strong>Christina:</strong>\r\n\r\nHun brenner for matlaging og gode smakskombinasjoner!\r\n\r\nHun elsker å teste nye oppskrifter på kjøkkenet, og gjøre andre glade med sine sunne og deilige retter!\r\n\r\n<strong>Marlin:</strong>\r\n\r\nHun elsker prosessen med å “skape noe” og tenker STORT. Det å kunne bidra med jobber for andre, samt å utvikle konsept og/eller merkevare er ting hun brenner for!\r\n\r\n<strong>Historien bak Double Down Dish AS:</strong>\r\n\r\nVi var begge hjemme i barselpermisjon med døtrene våre da ideen til <strong>Double Down Dish</strong> kom. Jeg (Marlin) spurte Christina hva hun kunne tenke seg å gjøre når fødselspermisjonen er over. «Hvis jeg kunne leve av å være på kjøkkenet og lage god mat til andre, ville jeg blitt utrolig glad!»\r\n\r\nSå bestemte jeg meg for å realisere et konsept jeg hadde hatt i tankene i noen år, men aldri gjorde noe med.\r\n\r\nMed innspill fra våre forlovede (som også er bestevenner), ble vi enige om konseptet med matbokser for bedrifter. Reisen fra første idé til oppstart gikk veldig raskt og vi gleder oss nå til å videreutvikle konseptet med stadig nye visjoner i fremtiden!', 'Om oss', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2023-02-20 11:09:59', '2023-02-20 10:09:59', '', 0, 'http://demo.mufaqar.com/dev3/?page_id=26', 0, 'page', '', 0),
