(1044, 1, '2022-11-21 14:45:11', '2022-11-21 09:45:11', 'We are some zealots who believe that fresh, homemade and tasty food makes everyday life better. Double Down Dish AS was created for anyone who wants this during the working day, but who may not have the time or capacity for it.\r\n\r\nEvery day we make, pack and deliver lunch boxes to all you good people, at your workplace.\r\n\r\nWe have 3 categories to choose from each day: \"Dagens Brødmat\", \"Dagens Brødmat\" and \"Dagens Brødmat\" and \"Dagens Brødmat\".\r\n\r\nIn addition to tasty snacks, drinks and healthy snacks!\r\n\r\nAs we make everything from scratch, we can of course adapt the lunch boxes for allergens or other needs/wishes.\r\n\r\nSimple, effective and incredibly good!\r\n\r\nWho are we?\r\n\r\nChristina:\r\n\r\nShe is passionate about cooking and good flavor combinations!\r\n\r\nShe loves testing new recipes in the kitchen, and making others happy with her healthy and delicious dishes!\r\n\r\nMarlin:\r\n\r\nShe loves the process of \"creating something\" and thinks BIG. Being able to contribute with jobs for others, as well as developing a concept and/or brand are things she is passionate about!\r\n\r\n\r\nThe story behind Double Down Dish AS:\r\n\r\nWe were both at home on maternity leave with our daughters when the idea for the Double Down Dish came about. I (Marlin) asked Christina what she would like to do when her maternity leave is over. \"If I could make a living from being in the kitchen and cooking good food for others, I would be incredibly happy!\"\r\n\r\nThen I decided to realize a concept I had had in mind for a few years, but never did anything about.\r\n\r\nWith input from our fiancees (who are also best mates), we agreed on the concept of lunch boxes for businesses. The journey from first idea to start-up went very quickly and we are now looking forward to further developing the concept with ever-new visions in the future!\r\n', 'About Us', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2022-11-21 14:45:11', '2022-11-21 09:45:11', '', 26, 'https://doubledowndish.no/?p=1044', 0, 'revision', '', 0),
