(1425, 1, '2023-02-20 10:59:22', '2023-02-20 09:59:22', '<span style=\"font-weight: 400;\">Vi er noen ildsjeler som tror at fersk, hjemmelaget og smakfull mat gjør hverdagen bedre. Double Down Dish AS er laget for alle som ønsker dette i løpet av arbeidsdagen, men som kanskje ikke har tid eller kapasitet til det.</span>\r\n\r\n<span style=\"font-weight: 400;\">Hver dag lager, pakker og leverer vi matbokser til alle dere flinke folk, på arbeidsplassen deres.</span>\r\n\r\n<span style=\"font-weight: 400;\">Vi har 3 kategorier å velge mellom hver dag: «Dagens Brødmat», «Dagens Brødmat» og «Dagens Brødmat» og «Dagens Brødmat».</span>\r\n\r\n<span style=\"font-weight: 400;\">I tillegg til velsmakende snacks, drikke og sunn snacks!</span>\r\n\r\n<span style=\"font-weight: 400;\">Ettersom vi lager alt fra bunnen av kan vi selvsagt tilpasse matboksene for allergener eller andre behov/ønsker.</span>\r\n\r\n<span style=\"font-weight: 400;\">Enkelt, effektivt og utrolig godt!</span>\r\n\r\n<span style=\"font-weight: 400;\">Hvem er vi?</span>\r\n\r\n<span style=\"font-weight: 400;\">Christina:</span>\r\n\r\n<span style=\"font-weight: 400;\">Hun brenner for matlaging og gode smakskombinasjoner!</span>\r\n\r\n<span style=\"font-weight: 400;\">Hun elsker å teste nye oppskrifter på kjøkkenet, og gjøre andre glade med sine sunne og deilige retter!</span>\r\n\r\n<span style=\"font-weight: 400;\">Marlin:</span>\r\n\r\n<span style=\"font-weight: 400;\">Hun elsker prosessen med å \"skape noe\" og tenker STORT. Det å kunne bidra med jobber for andre, samt å utvikle konsept og/eller merkevare er ting hun brenner for!</span>\r\n\r\n<span style=\"font-weight: 400;\">Historien bak Double Down Dish AS:</span>\r\n\r\n<span style=\"font-weight: 400;\">Vi var begge hjemme i barselpermisjon med døtrene våre da ideen til Double Down Dish kom. Jeg (Marlin) spurte Christina hva hun kunne tenke seg å gjøre når fødselspermisjonen er over. «Hvis jeg kunne leve av å være på kjøkkenet og lage god mat til andre, ville jeg blitt utrolig glad!»</span>\r\n\r\n<span style=\"font-weight: 400;\">Så bestemte jeg meg for å realisere et konsept jeg hadde hatt i tankene i noen år, men aldri gjorde noe med.</span>\r\n\r\n<span style=\"font-weight: 400;\">Med innspill fra våre forlovede (som også er bestevenner), ble vi enige om konseptet med matbokser for bedrifter. Reisen fra første idé til oppstart gikk veldig raskt og vi gleder oss nå til å videreutvikle konseptet med stadig nye visjoner i fremtiden!</span>', 'Om oss', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2023-02-20 10:59:22', '2023-02-20 09:59:22', '', 26, 'https://doubledowndish.no/?p=1425', 0, 'revision', '', 0),
(1426, 1, '2023-02-20 11:00:24', '2023-02-20 10:00:24', 'Vi er noen ildsjeler som tror at fersk, hjemmelaget og smakfull mat gjør hverdagen bedre. Double Down Dish AS er laget for alle som ønsker dette i løpet av arbeidsdagen, men som kanskje ikke har tid eller kapasitet til det.\n\nHver dag lager, pakker og leverer vi matbokser til alle dere flinke folk, på arbeidsplassen deres.\n\nVi har 3 kategorier å velge mellom hver dag: «Dagens Brødmat», «Dagens Brødmat» og «Dagens Brødmat» og «Dagens Brødmat».\n\nI tillegg til velsmakende snacks, drikke og sunn snacks!\n\nEttersom vi lager alt fra bunnen av kan vi selvsagt tilpasse matboksene for allergener eller andre behov/ønsker.\n\nEnkelt, effektivt og utrolig godt!\n<h5>Hvem er vi?</h5>\nChristina:\n\nHun brenner for matlaging og gode smakskombinasjoner!\n\nHun elsker å teste nye oppskrifter på kjøkkenet, og gjøre andre glade med sine sunne og deilige retter!\n\nMarlin:\n\nHun elsker prosessen med å “skape noe” og tenker STORT. Det å kunne bidra med jobber for andre, samt å utvikle konsept og/eller merkevare er ting hun brenner for!\n\nHistorien bak Double Down Dish AS:\n\nVi var begge hjemme i barselpermisjon med døtrene våre da ideen til Double Down Dish kom. Jeg (Marlin) spurte Christina hva hun kunne tenke seg å gjøre når fødselspermisjonen er over. «Hvis jeg kunne leve av å være på kjøkkenet og lage god mat til andre, ville jeg blitt utrolig glad!»\n\nSå bestemte jeg meg for å realisere et konsept jeg hadde hatt i tankene i noen år, men aldri gjorde noe med.\n\nMed innspill fra våre forlovede (som også er bestevenner), ble vi enige om konseptet med matbokser for bedrifter. Reisen fra første idé til oppstart gikk veldig raskt og vi gleder oss nå til å videreutvikle konseptet med stadig nye visjoner i fremtiden!', 'Om oss', '', 'inherit', 'closed', 'closed', '', '26-autosave-v1', '', '', '2023-02-20 11:00:24', '2023-02-20 10:00:24', '', 26, 'https://doubledowndish.no/?p=1426', 0, 'revision', '', 0),
