INSERT INTO `dv3_trp_dictionary_en_us_nb_no` (`id`, `original`, `translated`, `status`, `block_type`, `original_id`) VALUES
(1, 'Company Profile', 'Bedriftsprofil', 2, 0, 1),
(2, 'How its Work', 'Slik virker det', 2, 0, 2),
(3, 'Meeting Food', 'Møtemat', 2, 0, 3),
(4, 'About Us', 'Om oss', 2, 0, 4),
(5, 'Blog', 'Blogg', 2, 0, 5),
(6, 'My Profile', 'Min profil', 2, 0, 6),
(7, 'Lunch', 'Lunsjbokser til din bedrift', 2, 0, 7),
