(10, 'Service', '', 0, 0, 10),
(11, 'Smart job lunch with full flexibility and cost control...', 'Smart jobblunsj med full fleksibilitet og kostnadskontroll', 2, 0, 11),
(12, 'The Sea', 'Les mer', 2, 0, 12),
(13, 'We are your canteen 2.0', 'Vi er din 2.0 kantine,', 2, 0, 13),
(14, 'Digital Management', 'Digital ledelse', 2, 0, 14),
(15, 'for a varied, nutritious and', 'for en variert, næringsrik og', 2, 0, 15),
(16, 'Flexible job lunch', 'Fleksibel jobblunsj', 2, 0, 16),
(17, 'The company saves time on administration and gets a flexible lunch arrangement where you obviously do not pay\n    for lunch on the days that are canceled. Have a good lunch!', 'Bedriften sparer tid på administrasjon og får en fleksibel lunsjordning hvor du åpenbart ikke betaler\n     for lunsj de dagene som er kansellerte. Spesielle behov som f eks vegan, vegetar eller allergener kan legges inn. Ha en fin lunsj!', 2, 0, 17),
(18, '1. Register', '1. Registrere', 2, 0, 18),
(19, 'Register your business in minutes. If you order before 11 am, you can have lunch the next\n                    day.', 'Registrer bedriften din på få minutter. Bestiller du før kl 11, kan du spise lunsj neste\n                     dag.', 2, 0, 19),
(20, '2. Add employees', '2. Legg til ansatte', 2, 0, 20),
(21, 'Each employee selects a menu and can easily cancel, change or add additional products on My\n                    page.', 'Hver ansatt velger en sine lunsjretter og kan enkelt avbryte, endre eller legge til tilleggsprodukter på Min Side.', 2, 0, 21),
(22, '3. Welcome!', '3. Velkommen', 2, 0, 22),
(23, 'You will hear from us after you have registered so that we make sure that you get exactly\n                    what you want. We deliver to all types of companies regardless of size.', 'Du hører fra oss etter at du har registrert deg slik at vi sørger for at du får nøyaktig\n                     hva du vil. Vi leverer til alle typer bedrifter uansett størrelse.', 2, 0, 23),
(24, '4. Fix it done!', '4. Fiks ferdig!', 2, 0, 24),
(25, 'All employees receive a stress-free and good lunch that is good for the body, delivered to\n                    the door by 1115 every day.', 'Alle ansatte får en stressfri og god lunsj som er god for kroppen, levert til\n                     døren innen 11:15 hver dag.', 2, 0, 25),
(26, 'Start Now', 'Start nå', 2, 0, 26),
(27, 'Order without a company agreement?', 'Bestille utenfor en bedrift?', 2, 0, 27),
(28, 'Price NOK 79.13', 'Pris NOK 79.35', 2, 0, 28),
(29, 'Really big company? Get in touch and we will find a solution!', 'Virkelig stort bedrift? Ta kontakt så finner vi en løsning!', 2, 0, 29),
