(1532, 'We are some zealots who believe that fresh, homemade and tasty food makes everyday life better.', 'Vi er noen ildsjeler som mener at fersk, hjemmelaget og smakfull mat gjør hverdagen bedre. Double Down Dish AS ble til for alle som ønsker seg dette i løpet av arbeidsdagen, men som muligens ikke har tid eller kapasitet til det.', 2, 0, 1532),
(1533, 'was created for anyone who wants this during the working day, but who may not have the time or capacity for it.', '', 0, 0, 1533),
(1534, 'Every day we make, pack and deliver lunch boxes to all you good people, at your workplace.', 'Hver dag lager, pakker og leverer vi lunsjbokser til alle dere flinke folk, på arbeidsplassen deres.', 2, 0, 1534),
(1535, 'We have 3 categories to choose from each day:', '', 0, 0, 1535),
(1536, '&#8220;Dagens Brødmat&#8221;', '', 0, 0, 1536),
(1537, 'and', '', 0, 0, 1537),
(1538, 'In addition to tasty snacks, drinks and healthy snacks!', 'I tillegg til velsmakende snacks, drinker og sunne snacks!', 2, 0, 1538),
(1539, 'As we make everything from scratch, we can of course adapt the lunch boxes for allergens or other needs/wishes.', 'Ettersom vi lager alt fra bunnen av kan vi selvsagt tilpasse matboksene for allergener eller andre behov/ønsker.', 2, 0, 1539),
(1540, 'Simple, effective and incredibly good!', 'Da vi lager alt fra bunnen av, kan vi selvfølgelig tilpasse lunsjboksene for allergener eller andre behov/ ønsker. \n\n\n\nEnkelt, effektivt og utrolig godt!', 2, 0, 1540),
(1541, 'Who are we?', 'Hvem er vi?', 2, 0, 1541),
(1542, 'Christina:', '', 0, 0, 1542),
(1543, 'She is passionate about cooking and good flavor combinations!', 'Hun er lidenskapelig opptatt av matlaging og gode smakskombinasjoner!', 2, 0, 1543),
(1544, 'She loves testing new recipes in the kitchen, and making others happy with her healthy and delicious dishes!', 'Hun elsker å teste nye oppskrifter på kjøkkenet, og gjøre andre glade ved hjelp av sine sunne og gode retter!', 2, 0, 1544),
(1545, 'Marlin:', '', 0, 0, 1545),
(1546, 'She loves the process of &#8220;creating something&#8221; and thinks BIG. Being able to contribute with jobs for others, as well as developing a concept and/or brand are things she is passionate about!', 'Hun elsker prosessen av «å skape noe» og tenker STORT. Å kunne bidra med arbeidsplasser for andre, samt utvikle et konsept og/ eller brand er ting hun brenner for!', 2, 0, 1546),
(1547, 'The story behind Double Down Dish AS:', 'Historien bak Double Down Dish AS:', 2, 0, 1547),
(1548, 'We were both at home on maternity leave with our daughters when the idea for the', '', 0, 0, 1548),
(1549, 'came about. I (Marlin) asked Christina what she would like to do when her maternity leave is over. &#8220;If I could make a living from being in the kitchen and cooking good food for others, I would be incredibly happy!&#8221;', '', 0, 0, 1549),
(1550, 'Then I decided to realize a concept I had had in mind for a few years, but never did anything about.', 'Da bestemte jeg meg for å realisere et konsept jeg hadde hatt i tankene i noen år, men aldri gjort noe med.', 2, 0, 1550),
(1551, 'With input from our fiancees (who are also best mates), we agreed on the concept of lunch boxes for businesses. The journey from first idea to start-up went very quickly and we are now looking forward to further developing the concept with ever-new visions in the future!', 'Med innspill fra våre forlovede (som for øvrig er bestekamerater) ble vi enige om konseptet rundt lunsjbokser til bedrifter. Reisen fra første idé til oppstart gikk svært raskt og nå gleder vi oss til å videreutvikle konseptet med stadig nye visjoner i fremtiden!', 2, 0, 1551),
(1552, 'We were both at home on maternity leave with our daughters when the idea for the<strong> Double Down Dish</strong> came about. I (Marlin) asked Christina what she would like to do when her maternity leave is over. “If I could make a living from being in the kitchen and cooking good food for others, I would be incredibly happy!”', 'Vi gikk begge hjemme i barsel med våre døtre da ideen om Double Down Dish ble til. Jeg (Marlin) spurte Christina hva hun kunne tenke seg å gjøre når barseltiden var over. «Om jeg kunne leve av å være på kjøkkenet og lage god mat til andre, hadde jeg vært utrolig fornøyd!»', 2, 1, 1552),
(1553, 'We are some zealots who believe that fresh, homemade and tasty food makes everyday life better.<strong> Double Down Dish AS</strong> was created for anyone who wants this during the working day, but who may not have the time or capacity for it.', 'Vi er noen ildsjeler som mener at fersk, hjemmelaget og smakfull mat gjør hverdagen bedre. Double Down Dish AS ble til for alle som ønsker seg dette i løpet av arbeidsdagen, men som muligens ikke har tid eller kapasitet til det.', 2, 1, 1553),
(1554, 'We have 3 categories to choose from each day: <strong>“Dagens Brødmat”</strong>, <strong>“Dagens Brødmat”</strong> and <strong>“Dagens Brødmat”</strong> and <strong>“Dagens Brødmat”</strong>.', 'Vi har 3 kategorier å velge mellom hver dag: «Dagens Brødmat», «Dagens Wrap» og «Dagens Salat».', 2, 1, 1554),
