(78, 'Who we are', '', 'default', 0, 78, NULL),
(79, 'Our website address is: %s.', '', 'default', 0, 79, NULL),
(80, 'When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.', '', 'default', 0, 80, NULL),
(81, 'An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.', '', 'default', 0, 81, NULL),
(82, 'Media', '', 'default', 0, 82, NULL),
(83, 'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.', '', 'default', 0, 83, NULL),
(84, 'Cookies', '', 'default', 0, 84, NULL),
(85, 'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.', '', 'default', 0, 85, NULL),
(86, 'If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.', '', 'default', 0, 86, NULL),
(87, 'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.', '', 'default', 0, 87, NULL),
(88, 'If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.', '', 'default', 0, 88, NULL),
(89, 'Embedded content from other websites', '', 'default', 0, 89, NULL),
(90, 'Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.', '', 'default', 0, 90, NULL),
(91, 'These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.', '', 'default', 0, 91, NULL),
(92, 'Who we share your data with', '', 'default', 0, 92, NULL),
(93, 'If you request a password reset, your IP address will be included in the reset email.', '', 'default', 0, 93, NULL),
(94, 'How long we retain your data', '', 'default', 0, 94, NULL),
(95, 'If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.', '', 'default', 0, 95, NULL),
(96, 'For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.', '', 'default', 0, 96, NULL),
(97, 'What rights you have over your data', '', 'default', 0, 97, NULL),
(98, 'If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.', '', 'default', 0, 98, NULL),
(99, 'Where your data is sent', '', 'default', 0, 99, NULL),
(100, 'Visitor comments may be checked through an automated spam detection service.', '', 'default', 0, 100, NULL),
(101, 'WordPress', '', 'default', 0, 101, NULL),
