(976, 'Please use the Help & Support tab to get in touch should you find yourself requiring assistance.', 'acf', 'trp_context', ''),
(977, 'Help & Support', 'acf', 'trp_context', ''),
(978, 'We are fanatical about support, and want you to get the best out of your website with ACF. If you run into any difficulties, there are several places you can find help:', 'acf', 'trp_context', ''),
(979, '<a href=\\\"%s\\\" target=\\\"_blank\\\">Documentation</a>. Our extensive documentation contains references and guides for most situations you may encounter.', 'acf', 'trp_context', ''),
