(1502, 'Opt in to our security and feature updates notifications, and non-sensitive diagnostic tracking.', 'translatepress-multilingual', 'trp_context', ''),
(1503, '<strong>TranslatePress</strong> encountered SQL errors. <a href=\\\"%s\\\" title=\\\"View TranslatePress SQL Errors\\\">Check out the errors</a>.', 'translatepress-multilingual', 'trp_context', ''),
(1504, 'Automatic translation has been disabled.', 'translatepress-multilingual', 'trp_context', ''),
(1505, 'Logged errors', 'translatepress-multilingual', 'trp_context', ''),
(1506, 'These are the most recent 5 errors logged by TranslatePress:', 'translatepress-multilingual', 'trp_context', ''),
(1507, 'Why are these errors occuring', 'translatepress-multilingual', 'trp_context', ''),
(1508, 'If TranslatePress detects something wrong when executing queries on your database, it may disable the Automatic Translation feature in order to avoid any extra charging by Google/DeepL. Automatic Translation needs to be manually turned on, after you solve the issues.', 'translatepress-multilingual', 'trp_context', ''),
(1509, 'The SQL errors detected can occur for various reasons including missing tables, missing permissions for the SQL user to create tables or perform other operations, problems after site migration or changes to SQL server configuration.', 'translatepress-multilingual', 'trp_context', ''),
(1510, 'What you can do in this situation', 'translatepress-multilingual', 'trp_context', ''),
(1511, 'Plan A.', 'translatepress-multilingual', 'trp_context', ''),
(1512, 'Go to Settings -> TranslatePress -> General tab and Save Settings. This will regenerate the tables using your current SQL settings. Check if no more errors occur while browsing your website in a translated language. Look at the timestamps of the errors to make sure you are not seeing the old errors. Only the most recent 5 errors are displayed.', 'translatepress-multilingual', 'trp_context', ''),
(1513, 'Plan B.', 'translatepress-multilingual', 'trp_context', ''),
(1514, 'If your problem isn\'t solved, try the following steps:', 'translatepress-multilingual', 'trp_context', ''),
(1515, 'Create a backup of your database', 'translatepress-multilingual', 'trp_context', ''),
(1516, 'Create a copy of each translation table where you encounter errors. You can copy the table within the same database (trp_dictionary_en_us_es_es_COPY for example) -- perform this step only if you want to keep the current translations', 'translatepress-multilingual', 'trp_context', ''),
(1517, 'Remove the trouble tables by executing the DROP function on them', 'translatepress-multilingual', 'trp_context', ''),
(1518, 'Go to Settings -> TranslatePress -> General tab and Save Settings. This will regenerate the tables using your current SQL server.', 'translatepress-multilingual', 'trp_context', ''),
(1519, 'Copy the relevant content from the duplicated tables (trp_dictionary_en_us_es_es_COPY for example) in the newly generated table (trp_dictionary_en_us_es_es) -- perform this step only if you want to keep the current translations', 'translatepress-multilingual', 'trp_context', ''),
(1520, 'Test it to see if everything is working. If something went wrong, you can restore the backup that you\'ve made at the first step. Check if no more errors occur while browsing your website in a translated language. Look at the timestamps of the errors to make sure you are not seeing the old errors. Only the most recent 5 errors are displayed.', 'translatepress-multilingual', 'trp_context', ''),
(1521, 'Plan C.', 'translatepress-multilingual', 'trp_context', ''),
(1522, 'If your problem still isn\'t solved, try asking your hosting about your errors. The most common issue is missing permissions for the SQL user, such as the Create Tables permission.', 'translatepress-multilingual', 'trp_context', ''),
