(611, '[Double Down Dish] Your Site is Experiencing a Technical Issue'),
(612, 'Howdy!\n\nSince WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.\n\nIn this case, WordPress caught an error with your theme, Double Down Dish.\n\nFirst, visit your website (http://demo.mufaqar.com/dev3/) and check for any visible issues. Next, visit the page where the error was caught (http://demo.mufaqar.com/dev3/dev3/wp-admin/admin-ajax.php) and check for any visible issues.\n\nPlease contact your host for assistance with investigating this issue further.\n\nIf your site appears broken and you can\'t access your dashboard normally, WordPress now has a special \"recovery mode\". This lets you safely login to your dashboard and investigate further.\n\nhttp://demo.mufaqar.com/dev3/wp-login.php?action=enter_recovery_mode&rm_token=soQ5gBNvUruVhLwGCVvEWS&rm_key=xdFnNT0neT8dmbUXyyZFR7\n\nTo keep your site safe, this link will expire in 1 day. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.\n\nWhen seeking help with this issue, you may be asked for some of the following information:\nWordPress version 6.0.2\r\nActive theme: Double Down Dish (version 3.0.1)\r\nCurrent plugin:  (version )\r\nPHP version 7.4.30\n\n\n\nError Details\n=============\nAn error of type E_PARSE was caused in line 850 of the file /home/u502850329/domains/mufaqar.com/public_html/demo/dev3/wp-content/themes/double-down/inc/ajax_request.php. Error message: syntax error, unexpected \'}\''),
